import React from "react";

import "./HomeFourthSection.css";

import danceImg from "../assets/images/activities/dance yoga.png";
import exhibitionsImg from "../assets/images/activities/exhibitions.png";
import photoshootImg from "../assets/images/activities/photoshoot.png";
import funActImg from "../assets/images/activities/art fun activities.png";
import potteryImg from "../assets/images/activities/pottery.png";
import workshopImg from "../assets/images/activities/workshops.png";

const HomeFourthSection = () => {
  return (
    <div className="mainFourth container c-row">
      <div className="container image-column c-col">
        <div className="image-box">
          <h4>DANCE, YOGA</h4>
        </div>
        <div className="image-box">
          <h4>EXHIBITIONS</h4>
        </div>
        <div className="image-box">
          <h4>PHOTOSHOOT</h4>
        </div>
      </div>
      <div className="container heading-column"></div>
      <div className="container image-column c-col">
        <div className="image-box">
          <h4>ART & FUN ACTIVITIES</h4>
        </div>
        <div className="image-box">
          <h4>POTTERY</h4>
        </div>
        <div className="image-box">
          <h4>WORKSHOPS</h4>
        </div>
      </div>
    </div>
  );
};

export default HomeFourthSection;
